import React from 'react'
import { withRouter, Link } from 'react-router-dom'

const Returnix = props => {
  console.log(props)
  return (
    <div>
      <h3 onClick={() => props.history.push('/')}>vratit na homopage</h3>
      {props.location.pathname}
    </div>
  )
}

const RouteToHome = withRouter(Returnix)

const Contacts = props => {
  return (
    <section>
      <h1>kontakty</h1>
      <hr />
      <hr />
      <h4>pomoci LINK</h4>
      <Link to="/">Domu</Link>
      <br />
      <br />
      <hr />
      <hr />
      <RouteToHome />
    </section>
  )
}

export default Contacts
